Messiah 4 - The Harrowing (2005)

De vierde  miniserie uit de Messiah-reeks. Als het team van hoofdinspecteur Red Metcalfe aankomt bij een bestelbusje op een verlaten vuilstortplaats, komen ze er al snel achter dat dit een moordzaak is die zijn gelijke niet kent. Reds analytische kwaliteiten worden tot het uiterste getest als hij probeert in het hoofd te kruipen van een moordenaar die vast van plan is hier op aarde een hel te ontketenen. (van bol.com)

